  return(
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/additem" element={<AddItem/>}/>
        <Route path="/generator" element={<Generator/>}/>
        <Route path="/inventory" element={<Inventory/>}/>
      </Routes>
    </BrowserRouter>
  )
}

export default App;
